import logo from "./logo.svg";
import "./App.css";
import { Navbar, Container } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <Navbar>
      <Container>
        <ul>
          <li>
            <a href="#">Home</a>
          </li>
          <li>
            <a href="#">Service</a>
          </li>
        </ul>
      </Container>
    </Navbar>
  );
}

export default App;
